JSON.stringify({
    variables:  {
  "input": {
    "carrier": {
      "code": appsmith.store.queryMoveCarrierCode
    },
    "groupBy": {
      "material": true,
      "carrier": true,
      "status": true,
      "storageLocation": true
    }
  }
},
    query: `
query ($input:StockOnHandFilter){
  getStockOnHand(filter:$input){
    material{
      code
    }
    carrier{
      id
			code
    }
    status{
      code
    }
    storageLocation{
      name
    }
    quantity
  }
}
    `
})

JSON.stringify({
    variables:  {
	"input": appsmith.user.email
},
    query: `
query($input:String){
  getUser(username:$input){
			id
    hasRole{
      responsibilities(filter:{equipmentLevel:{eq:Site}}){
        value: id
        label: name
        equipmentLevel
      }
    }
  }
}
    `
})

JSON.stringify({
    variables:  {
	"input": SiteSelect.selectedOptionValue
},
    query: `
query($input:ID!){
  getEquipment(id:$input){
    name
    children(filter:{equipmentLevel:{eq:Warehouse}}){
				value: id
      label: name
      equipmentLevel
    }
  }
}
    `
})

